<!doctype html><html><head><meta charset="utf-8"><meta name="viewport" content="width=device-width,initial-scale=1"><meta name="description" content="Lightweight solution for deploying single page apps with GitHub Pages."><link href="https://cdn.jsdelivr.net/npm/react-vertical-timeline-component@3.6.0/style.min.css" rel="stylesheet"><meta http-equiv="Content-Security-Policy" content="upgrade-insecure-requests"><title>custom name</title><script>// Single Page Apps for GitHub Pages
      // MIT License
      // https://github.com/rafgraph/spa-github-pages
      // This script checks to see if a redirect is present in the query string,
      // converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function (l) {
        if (l.search[1] === '/') {
          var decoded = l.search.slice(1).split('&').map(function (s) {
            return s.replace(/~and~/g, '&')
          }).join('?');
          window.history.replaceState(null, null,
            l.pathname.slice(0, -1) + decoded + l.hash
          );
        }
      }(window.location))</script><link rel="icon" href="./dist/dashboard.ico"><script defer="defer" src="./dist/facfdf494d0e64f1f802.js"></script><script defer="defer" src="./dist/fea19f77a8cc45550190.js"></script><script defer="defer" src="./dist/d9393f51f82ace09240d.js"></script></head><body id="body-main"><div id="root"></div></body></html>
